  export default function Category1(props) {
    return (
      <div className="flex justify-center bg-black border-black rounded-3xl border-solid border-2 w-[500px] h-[400px] ">
        <div className=" bg-catbg1 border-black rounded-3xl w-[500px] h-[380px] text-center">
          <h1 className=" text-8xl font-fleuronmixed ">CODING</h1>
          <p>Coding club events that test your programming ability</p>
          <button className="align-middle bg-[#E5FAFF] border-black border-2 rounded-md w-[200px]">Dive in</button>
        </div>
      </div>
      
    )
  }
